import React from 'react';

import Wrapper from '../../UI/Wrapper/Wrapper';
import CarServices from '../Book/CarServices';

import classes from './CarInfo.module.css';

const CarInfo = (props) => {
  const pickCar = props.cars.filter((car) => car.id === props.loadCarId);

  const onAddHandler = (service) => {
    const getServices = pickCar.map((car) => {
      return car.services;
    });
    getServices[0].push(service);
    props.editCar(pickCar);
  };

  const infoCar = pickCar.map((car) => {
    return (
      <Wrapper key={car.id}>
        <div className={classes['car-info-list']}>
          <ul>
            <li>
              brand:<p>{car.brand}</p>
            </li>
            <li>
              series:<p>{car.series}</p>
            </li>
            <li>
              model:<p>{car.model}</p>
            </li>
            <li>
              year:<p>{car.year}</p>
            </li>
            <li>
              engine:<p>{car.engine}</p>
            </li>
            <li>
              mileage:<p>{car.mileage}</p>
            </li>
          </ul>
        </div>
        
      </Wrapper>
    );
  });

  // <CarServices
  //         services={car.services}
  //         sendNewService={onAddHandler}
  //       />

  return <div className={classes['car-info']}>{infoCar}</div>;
};

export default CarInfo;
